def sum_char_positions(s, masked_indices):
    sum = 0
    masked = set(masked_indices)
    for i, ch in enumerate(s.lower()):
        if i in masked:
            continue
        if 'a' <= ch <= 'z':
            sum += ord(ch) - ord('a') + 1
    return sum

